INSERT INTO resource.resources (id, name, content, type_id, create_time, update_time, enable, remark, icon) VALUES (455, 'Athena', 'https://github.com/didi/athena', 111, '2021-02-02 09:26:51', null, 0, 'Athena是端到端自动语音识别（ASR）引擎的开源实现。目前，该项目支持基于连接器时间分类（CTC）的模型，基于变压器的编解码器模型和基于混合CTC /注意的模型以及基于MPC的无监督预转换的训练和解码。我们的愿景是增强语音识别的端到端模型的工业应用和学术研究。为了使所有人都能使用ASR，我们还发布了一些示例示例，这些示例实现基于一些开源数据集，例如HKSUT，Librispeech我们所有的模型都在Tensorflow> = 2.0.0中实现。', null);
